--Hero6 Database - Project for CS275
--Developed by Robert Kety

--Create Database Tables

--users - Contains login details for CS494 requriement
CREATE TABLE IF NOT EXISTS users(
  id INT UNSIGNED NOT NULL AUTO_INCREMENT,
  username VARCHAR(255) NOT NULL,
  passwordHash VARCHAR(255) NOT NULL COMMENT 'Requires PHPASS hash',
  rooms INT UNSIGNED NOT NULL DEFAULT 0,
  views INT UNSIGNED NOT NULL DEFAULT 0,
  characters INT UNSIGNED NOT NULL DEFAULT 0,
  dialogs INT UNSIGNED NOT NULL DEFAULT 0,
  editTables INT UNSIGNED NOT NULL DEFAULT 0,
  PRIMARY KEY (id)
)ENGINE = InnoDB;

--room
SET FOREIGN_KEY_CHECKS=0;
DROP TABLE IF EXISTS room;
CREATE TABLE room(
  id INT UNSIGNED NOT NULL,
  description VARCHAR(45),
  PRIMARY KEY (id)
)ENGINE = InnoDB;
SET FOREIGN_KEY_CHECKS=1;

--exitDirection
SET FOREIGN_KEY_CHECKS=0;
DROP TABLE IF EXISTS exitDirection;
CREATE TABLE exitDirection(
  id INT UNSIGNED NOT NULL AUTO_INCREMENT,
  direction VARCHAR(45) NOT NULL,
  PRIMARY KEY (id)
)ENGINE = InnoDB;
SET FOREIGN_KEY_CHECKS=1;

--roomExitDirection
SET FOREIGN_KEY_CHECKS=0;
DROP TABLE IF EXISTS roomExitDirection;
CREATE TABLE roomExitDirection(
  originRid INT UNSIGNED NOT NULL AUTO_INCREMENT,
  edid INT UNSIGNED NOT NULL,
  destinationRoom INT UNSIGNED NOT NULL,
  PRIMARY KEY (originRid, edid),
  FOREIGN KEY (originRid)
    REFERENCES room (id)
    ON DELETE CASCADE,
  FOREIGN KEY (edid)
    REFERENCES exitDirection (id),
  FOREIGN KEY (destinationRoom)
    REFERENCES room (id)
    ON DELETE CASCADE
)ENGINE = InnoDB;
SET FOREIGN_KEY_CHECKS=1;

--roomBackground
SET FOREIGN_KEY_CHECKS=0;
DROP TABLE IF EXISTS roomBackground;
CREATE TABLE roomBackground(
  rid INT UNSIGNED NOT NULL,
  bid INT UNSIGNED NULL AUTO_INCREMENT,
  path VARCHAR(255) NULL DEFAULT 'images/backgrounds/',
  fileName VARCHAR(255) NOT NULL DEFAULT 'default',
  extension VARCHAR(45) NOT NULL DEFAULT '.bmp',
  PRIMARY KEY (bid, rid),
  FOREIGN KEY (rid)
    REFERENCES room (id)
    ON DELETE CASCADE
)ENGINE = InnoDB;
SET FOREIGN_KEY_CHECKS=1;

--color
SET FOREIGN_KEY_CHECKS=0;
DROP TABLE IF EXISTS color;
CREATE TABLE color(
  id INT UNSIGNED AUTO_INCREMENT COMMENT 'The id range must start with 0, not 1 (i.e., color id 0 is r:0, g:0, b:0)',
  red INT UNSIGNED NOT NULL,
  green INT UNSIGNED NOT NULL,
  blue INT UNSIGNED NOT NULL,
  PRIMARY KEY (id)
)ENGINE = InnoDB;
SET FOREIGN_KEY_CHECKS=1;

--sprite
SET FOREIGN_KEY_CHECKS=0;
DROP TABLE IF EXISTS sprite;
CREATE TABLE sprite(
  id INT UNSIGNED NOT NULL,
  path VARCHAR(255) NULL DEFAULT 'images/sprites/',
  fileName VARCHAR(255) NOT NULL DEFAULT '0',
  extension VARCHAR(45) NOT NULL DEFAULT '.bmp',
  PRIMARY KEY (id)
)ENGINE = InnoDB;
SET FOREIGN_KEY_CHECKS=1;

--loops
SET FOREIGN_KEY_CHECKS=0;
DROP TABLE IF EXISTS loops;
CREATE TABLE loops(
  id INT UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id must start at 0, not 1.',
  direction VARCHAR(45) NOT NULL DEFAULT 'No special purpose',
  PRIMARY KEY (id)
)ENGINE = InnoDB;
SET FOREIGN_KEY_CHECKS=1;

--view
SET FOREIGN_KEY_CHECKS=0;
DROP TABLE IF EXISTS view;
CREATE TABLE view(
  id INT UNSIGNED NULL AUTO_INCREMENT,
  scriptName VARCHAR(45) NOT NULL DEFAULT 'View',
  PRIMARY KEY (id)
)ENGINE = InnoDB;
SET FOREIGN_KEY_CHECKS=1;

--viewLoopsFrame
SET FOREIGN_KEY_CHECKS=0;
DROP TABLE IF EXISTS viewLoopsFrame;
CREATE TABLE viewLoopsFrame(
  vid INT UNSIGNED NOT NULL,
  lid INT UNSIGNED NOT NULL,
  frameNum INT UNSIGNED NULL AUTO_INCREMENT,
  sid INT UNSIGNED NOT NULL DEFAULT 0,
  flipped INT NOT NULL DEFAULT 0 COMMENT 'Image flipped on vertical axis',
  PRIMARY KEY (frameNum, vid, lid),
  FOREIGN KEY (vid)
    REFERENCES view (id)
    ON DELETE CASCADE,
  CONSTRAINT LoopID
    FOREIGN KEY (lid)
    REFERENCES loops (id),
  CONSTRAINT Sprite
    FOREIGN KEY (sid)
    REFERENCES sprite (id)
)ENGINE = InnoDB;
SET FOREIGN_KEY_CHECKS=1;

--characters
SET FOREIGN_KEY_CHECKS=0;
DROP TABLE IF EXISTS characters;
CREATE TABLE characters(
  id INT UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id must start at 0, not 1.',
  scriptName VARCHAR(45) NOT NULL DEFAULT 'cChar',
  blinkVid INT UNSIGNED NULL DEFAULT NULL,
  idleVid INT UNSIGNED NULL DEFAULT NULL,
  normalVid INT UNSIGNED NULL DEFAULT 1,
  speechColor INT UNSIGNED NOT NULL DEFAULT 12,
  speechVid INT UNSIGNED NULL DEFAULT NULL,
  thinkVid INT UNSIGNED NULL DEFAULT NULL,
  realName VARCHAR(45) NOT NULL DEFAULT 'New character',
  startingRid INT UNSIGNED NULL DEFAULT NULL,
  startingX INT NOT NULL DEFAULT 160,
  startingY INT NOT NULL DEFAULT 120,
  PRIMARY KEY (id),
  FOREIGN KEY (startingRid)
    REFERENCES room (id)
    ON DELETE SET NULL,
  FOREIGN KEY (normalVid)
    REFERENCES view (id)
    ON DELETE SET NULL,
  FOREIGN KEY (speechVid)
    REFERENCES view (id)
    ON DELETE SET NULL,
  FOREIGN KEY (speechColor)
    REFERENCES color (id),
  FOREIGN KEY (blinkVid)
    REFERENCES view (id)
    ON DELETE SET NULL,
  FOREIGN KEY (idleVid)
    REFERENCES view (id)
    ON DELETE SET NULL,
  FOREIGN KEY (thinkVid)
    REFERENCES view (id)
    ON DELETE SET NULL
)ENGINE = InnoDB;
SET FOREIGN_KEY_CHECKS=1;

--dialog
SET FOREIGN_KEY_CHECKS=0;
DROP TABLE IF EXISTS dialog;
CREATE TABLE dialog(
  id INT UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id must start at 0, not 1.',
  scriptName VARCHAR(45) NOT NULL DEFAULT 'dDialog1',
  cid INT UNSIGNED NULL DEFAULT NULL,
  PRIMARY KEY (id),
  FOREIGN KEY (cid)
    REFERENCES characters (id)
    ON DELETE SET NULL
)ENGINE = InnoDB;
SET FOREIGN_KEY_CHECKS=1;

